import React from 'react';
import GoogleMapReact from 'google-map-react';
import Marker from 'google-map-react';
import { Wrapper, Status } from "@googlemaps/react-wrapper";

class Map extends React.Component {
  render() {
    return (
      <>
      <Wrapper apiKey={"AIzaSyDRA8KWu6hfAC7vyYG8h4FQ48UzNymOjUc"} render={render}>
        <GoogleMapReact
          center={{lat: 18.622761, lng: 73.741953}}
          zoom={12}
          style={{height: '400px', width: '400px'}}
          apiKey="AIzaSyDRA8KWu6hfAC7vyYG8h4FQ48UzNymOjUc"
          >
          <Marker
            lat={18.622761}
            lng={73.741953}
            text="New York City"
            />
        </GoogleMapReact>
      </Wrapper>
      
      </>
    );
  }
}

export default Map;
